    false,nt"url": null,nt"notes": "This Heritage Resource Management Plan
    describes past and present maritime research conducted to support the management
    of Papahanaumokuakea Marine National Monument (Monument) and to develop a framework
    for the future. This document is one of several "step-down" plans called for in
    the Monument Management Plan. Maritime heritage management in the Monument has focused
    primarily on the inventory, documentation, and interpretation of maritime sites
    as they are defined in the Monument's Maritime Heritage Action Plan:"resources
    including submerged and beached shipwrecks, aircraft, and other sites of historical,
    cultural and archaeological significance." This document addresses these attempts
    to inventory and protect the maritime heritage sites in the Monument.",nt"license_title":
